var errorCode=process.argv[2];var max=process.argv[3];var modes=process.argv.slice(4);function stdout(a){if(modes.indexOf("stdout")===-1){return}process.stdout.write("stdout "+a+"\n")}function stderr(a){if(modes.indexOf("stderr")===-1){return}process.stderr.write("stderr "+a+"\n")}for(var i=0;i<max;i++){stdout(i);stderr(i)}process.exit(errorCode);stdout("fail");stderr("fail");